import React from "react";

export default class SignUpEmail extends React.Component {
  isNormalEmail = () => {
    const email = this.emailInput.value;
    console.log(email);
  };
  render() {
    return (
      <div>
        <label htmlFor="Email">{"Email:"}</label>
        <input
          ref={(element) => (this.emailInput = element)}
          id="Email"
          type={"email"}
        ></input>
      </div>
    );
  }
}
